                    range: true,
                    min: Number(minPrice),
                    max: Number(maxPrice),
                    values: [selectedMin, selectedMax],
                    slide: function (event, ui) {
                        $(""#amount"").val(""£"" + ui.values[0] + "" - £"" + ui.values[1]);
                    },
               ");
